import React from 'react'

const items = ({title, sentence, image}) => {
    return (
        [{
            title: title,
            sentence : sentence,
            image : image
        }]
    )
}

export const SecondList = () => {
    return (
         <div className="list mb-4">
             { items.map((item, i) => (
                    <div className="list-item flex items-center justify-start p-2 space-x-4" key={i}>
                        <img
                            src={item.image}
                            alt="media"
                            className="h-20 w-30 shadow-lg  shadow-outline"

                        />
                        <div className="flex flex-col w-full">
                            <div className="text-sm font-bold" children={item.title}> item.title </div>
                            <div className="text-sm" children={item.sentence}> item.sentence </div>
                            {/*                    <div className="flex flex-row items-center justify-around"/>*/}
                        </div>
                    </div>
                 ))}
         </div>
            )
}




